INSERT INTO `item_dex` (`Item_ID`, `Item_Name`, `Item_Type`, `Item_Description`) VALUES
(1, 'Ability Capsule', 'Held Item', 'A capsule that allows a Pokémon with two Abilities to switch between these Abilities when it is used.'),
(2, 'Ability Urge', 'Battle Item', 'When used, it activates the Ability of an ally Pokémon.'),
(3, 'Abomasite', 'Held Item', 'Enables Abomasnow to Mega Evolve during battle.'),
(4, 'Absolite', 'Held Item', 'Enables Absol to Mega Evolve during battle.'),
(5, 'Absorb Bulb', 'Held Item', 'A consumable bulb. If the holder is hit by a Water-type move, its Sp. Atk will rise.'),
(6, 'Adamant Orb', 'Held Item', 'Increases the power of Dragon- and Steel-type moves when held by Dialga.'),
(7, 'Adrenaline Orb', 'Held Item', 'Using it makes wild Pokémon more likely to call for help. If held by a Pokémon, it boosts Speed when intimidated. It can be used only once.'),
(8, 'Aerodactylite', 'Held Item', 'Enables Aerodactyl to Mega Evolve during battle.'),
(9, 'Aggronite', 'Held Item', 'Enables Aggron to Mega Evolve during battle.'),
(10, 'Aguav Berry', 'Berries', 'Restores HP if it\'s low, but may cause confusion.'),
(11, 'Air Balloon', 'Held Item', 'When held by a Pokémon, the Pokémon will float into the air. When the holder is attacked, this item will burst.'),
(12, 'Alakazite', 'Held Item', 'Enables Alakazam to Mega Evolve during battle.'),
(13, 'Aloraichium Z', 'Held Item', 'Allows Alolan Raichu to upgrade Thunderbolt to a Z-Move, Stoked Sparksurfer.'),
(14, 'Altarianite', 'Held Item', 'Enables Altaria to Mega Evolve during battle.'),
(15, 'Ampharosite', 'Held Item', 'Enables Ampharos to Mega Evolve during battle.'),
(16, 'Amulet Coin', 'Held Item', 'An item to be held by a Pokémon. It doubles a battle’s prize money if the holding Pokémon joins in.'),
(17, 'Antidote', 'Medicine', 'A spray-type medicine. It lifts the effect of poison from one Pokémon.'),
(18, 'Apicot Berry', 'Berries', 'Raises Special Defense when HP is low.'),
(19, 'Armor Fossil', 'General Item', 'A fossil from a prehistoric Pokémon that lived on the land. It appears to be part of a collar.'),
(20, 'Aspear Berry', 'Berries', 'If held by a Pokémon, it defrosts it.'),
(21, 'Assault Vest', 'Held Item', 'Raises Special Defense but prevents the use of status moves.'),
(22, 'Audinite', 'Held Item', 'Enables Audino to Mega Evolve during battle.'),
(23, 'Awakening', 'Medicine', 'A spray-type medicine. It awakens a Pokémon from the clutches of sleep.'),
(24, 'Babiri Berry', 'Berries', 'Weakens a supereffective Steel-type attack against the holding Pokémon.'),
(25, 'Balm Mushroom', 'General Item', 'A rare mushroom which gives off a nice fragrance. A maniac will buy it for a high price.'),
(26, 'Banettite', 'Held Item', 'Enables Banette to Mega Evolve during battle.'),
(27, 'Beast Ball', 'Pokeballs', 'A special Poké Ball designed to catch Ultra Beasts. It has a low success rate for catching others.'),
(28, 'Beedrillite', 'Held Item', 'Enables Beedrill to Mega Evolve during battle.'),
(29, 'Belue Berry', 'Berries', 'A Berry which is very rare in the Unova region. A maniac will buy it for a high price.'),
(30, 'Berry Juice', 'Medicine', 'A 100% pure juice made of Berries. It restores the HP of one Pokémon by just 20 points.'),
(31, 'Big Malasada', 'Medicine', 'The Alola region’s local specialty—fried bread. It can be used once to heal all the status conditions of a Pokémon.'),
(32, 'Big Mushroom', 'General Item', 'A large and rare mushroom. It is sought after by collectors.'),
(33, 'Big Nugget', 'General Item', 'A big nugget of pure gold that gives off a lustrous gleam. A maniac will buy it for a high price.'),
(34, 'Big Pearl', 'General Item', 'A quite-large pearl that sparkles in a pretty silver color. It can be sold at a high price to shops.'),
(35, 'Big Root', 'Held Item', 'Recovers more HP from HP-stealing moves.'),
(36, 'Binding Band', 'Held Item', 'A band that increases the power of binding moves when held.'),
(37, 'Black Apricorn', 'General Item', 'A black Apricorn It has an indescribable scent.'),
(38, 'Black Belt', 'Held Item', 'Increases the power of Fighting-type moves.'),
(39, 'Black Flute', 'General Item', 'A toy flute made from black glass. A maniac will buy it for a high price.'),
(40, 'Black Glasses', 'Held Item', 'Increases the power of Dark-type moves.'),
(41, 'Black Sludge', 'Held Item', 'A held item that gradually restores the HP of Poison-type Pokémon. It inflicts damage on all other types.'),
(42, 'Blastoisinite', 'Held Item', 'Enables Blastoise to Mega Evolve during battle.'),
(43, 'Blazikenite', 'Held Item', 'Enables Blaziken to Mega Evolve during battle.'),
(44, 'Blue Apricorn', 'General Item', 'A blue Apricorn. It smells a bit like grass.'),
(45, 'Blue Flute', 'General Item', 'A toy flute made from blue glass. A maniac will buy it for a high price.'),
(46, 'Blue Scarf', 'General Item', 'Raises holder\'s Beauty aspect in a Contest.'),
(47, 'Blue Shard', 'General Item', 'A small blue shard. It appears to be from some sort of implement made long ago.'),
(48, 'Bluk Berry', 'Berries', 'A Berry which is very rare in the Unova region. A maniac will buy it for a high price.'),
(49, 'Bottle Cap', 'General Item', 'A beautiful bottle cap that gives off a silver gleam. Some people are happy to receive one.'),
(50, 'Bright Powder', 'Held Item', 'Lowers the opponent’s accuracy.'),
(51, 'Bug Gem', 'Held Item', 'Increases the power of a Bug-type move only once.'),
(52, 'Bug Memory', 'Held Item', 'A memory disc that contains Bug-type data. It changes the type of the holder if held by a certain species of Pokémon.'),
(53, 'Buginium Z', 'Held Item', 'Allows the use of Savage Spin-Out, the Bug type Z-Move.'),
(54, 'Burn Drive', 'Held Item', 'Changes Techno Blast to a Fire-type move when held by Genesect.'),
(55, 'Burn Heal', 'Medicine', 'A spray-type medicine. It heals a single Pokémon that is suffering from a burn.'),
(56, 'Calcium', 'Medicine', 'A nutritious drink for Pokémon. It raises the base Sp. Atk (Special Attack) stat of a single Pokémon.'),
(57, 'Cameruptite', 'Held Item', 'Enables Camerupt to Mega Evolve during battle.'),
(58, 'Carbos', 'Medicine', 'A nutritious drink for Pokémon. It raises the base Speed stat of a single Pokémon.'),
(59, 'Casteliacone', 'Medicine', 'Castelia City’s specialty, soft-serve ice cream. It heals all the status problems of a single Pokémon.'),
(60, 'Cell Battery', 'Held Item', 'A consumable battery. If the holder is hit by an Electric-type move, its Attack will rise.'),
(61, 'Charcoal', 'Held Item', 'Increases the power of Fire-type moves.'),
(62, 'Charizardite X', 'Held Item', 'Enables Charizard to Mega Evolve during battle.'),
(63, 'Charizardite Y', 'Held Item', 'Enables Charizard to Mega Evolve during battle.'),
(64, 'Charti Berry', 'Berries', 'Weakens a supereffective Rock-type attack against the holding Pokémon.'),
(65, 'Cheri Berry', 'Berries', 'If held by a Pokémon, it recovers from paralysis.'),
(66, 'Cherish Ball', 'Pokeballs', 'A quite rare Poké Ball that has been specially crafted to commemorate an occasion of some sort.'),
(67, 'Chesto Berry', 'Berries', 'If held by a Pokémon, it recovers from sleep.'),
(68, 'Chilan Berry', 'Berries', 'Weakens a Normal-type attack against the Pokémon holding this berry.'),
(69, 'Chill Drive', 'Held Item', 'Changes Techno Blast to an Ice-type move when held by Genesect.'),
(70, 'Choice Band', 'Held Item', 'Raises Attack, but only one move can be used.'),
(71, 'Choice Scarf', 'Held Item', 'Raises Speed, but only one move can be used.'),
(72, 'Choice Specs', 'Held Item', 'Raises Special Attack, but only one move can be used.'),
(73, 'Chople Berry', 'Berries', 'Weakens a supereffective Fighting-type attack against the holding Pokémon.'),
(74, 'Claw Fossil', 'General Item', 'A fossil of an ancient Pokémon that lived in the sea. It appears to be part of a claw.'),
(75, 'Cleanse Tag', 'Held Item', 'An item to be held by a Pokémon. It helps keep wild Pokémon away if the holder is the first one in the party.'),
(76, 'Clever Wing', 'Medicine', 'Increases Special Defense EVs by 1.'),
(77, 'Coba Berry', 'Berries', 'Weakens a supereffective Flying-type attack against the holding Pokémon.'),
(78, 'Colbur Berry', 'Berries', 'Weakens a supereffective Dark-type attack against the holding Pokémon.'),
(79, 'Colress Machine', 'Held Item', 'A special device that wrings out the potential of Pokémon. It is an imperfect prototype.'),
(80, 'Comet Shard', 'General Item', 'A shard which fell to the ground when a comet approached. A maniac will buy it for a high price.'),
(81, 'Cornn Berry', 'Berries', 'A Berry which is very rare in the Unova region. A maniac will buy it for a high price.'),
(82, 'Cover Fossil', 'General Item', 'A fossil of an ancient Pokémon that lived in the sea in ancient times. It appears to be part of its back.'),
(83, 'Custap Berry', 'Berries', 'Holder can move first when HP is low.'),
(84, 'Damp Mulch', 'General Item', 'A fertilizer to be spread on soft soil in regions where Berries are grown. A maniac will buy it for a high price.'),
(85, 'Damp Rock', 'Held Item', 'A Pokémon held item that extends the duration of the move Rain Dance used by the holder.'),
(86, 'Dark Gem', 'Held Item', 'Increases the power of a Dark-type move only once.'),
(87, 'Dark Memory', 'Held Item', 'A memory disc that contains Dark-type data. It changes the type of the holder if held by a certain species of Pokémon.'),
(88, 'Darkinium Z', 'Held Item', 'Allows the use of Black Hole Eclipse, the Dark type Z-Move.'),
(89, 'Dawn Stone', 'General Item', 'A peculiar stone that makes certain species of Pokémon evolve. It sparkles like eyes.'),
(90, 'Decidium Z', 'Held Item', 'Allows Decidueye to upgrade Spirit Shackle to a Z-Move, Sinister Arrow Raid.'),
(91, 'Deep Sea Scale', 'Held Item', 'Increases Special Defense when held by Clamperl.'),
(92, 'Deep Sea Tooth', 'Held Item', 'Increases Special Attack when held by Clamperl.'),
(93, 'Destiny Knot', 'Held Item', 'A long, thin, bright-red string to be held by a Pokémon. If the holder becomes infatuated, the foe does too.'),
(94, 'Diancite', 'Held Item', 'Enables Diancie to Mega Evolve during battle.'),
(95, 'Dire Hit', 'Battle Item', 'Raises critical-hit ratio of a Pokémon in battle.'),
(96, 'Dire Hit 2', 'Battle Item', 'Raises a Pokémon\'s critical-hit ratio in battle.'),
(97, 'Dire Hit 3', 'Battle Item', 'Greatly raises a Pokémon’s critical-hit ratio in battle.'),
(98, 'Discount Coupon', 'General Item', 'This special coupon allows you to buy items at a discount when you are shopping at a boutique.'),
(99, 'Dive Ball', 'Pokeballs', 'A somewhat different Poké Ball that works especially well on Pokémon that live underwater.'),
(100, 'DNA Splicers', 'General Item', 'A splicer that fuses Kyurem and a certain Pokémon. They are said to have been one in the beginning.'),
(101, 'Dome Fossil', 'General Item', 'A fossil of an ancient Pokémon that lived in the sea. It appears to be part of a shell.'),
(102, 'Douse Drive', 'Held Item', 'Changes Techno Blast to a Water-type move when held by Genesect.'),
(103, 'Draco Plate', 'Held Item', 'Increases power of Dragon-type moves. Changes Arceus\' type to Dragon.'),
(104, 'Dragon Fang', 'Held Item', 'Increases the power of Dragon-type moves.'),
(105, 'Dragon Gem', 'Held Item', 'Increases the power of a Dragon-type move only once.'),
(106, 'Dragon Memory', 'Held Item', 'A memory disc that contains Dragon-type data. It changes the type of the holder if held by a certain species of Pokémon.'),
(107, 'Dragon Scale', 'General Item', 'A thick and tough scale. Dragon-type Pokémon may be holding this item when caught.'),
(108, 'Dragonium Z', 'Held Item', 'Allows the use of Devastating Drake, the Dragon type Z-Move.'),
(109, 'Dread Plate', 'Held Item', 'Increases power of Dark-type moves. Changes Arceus\' type to Dark.'),
(110, 'Dream Ball', 'Pokeballs', 'A special Poké Ball that appears out of nowhere in a bag at the Entree Forest. It can catch any Pokémon.'),
(111, 'Dropped Item', 'Held Item', 'The Xtransceiver found at the Nimbasa City amusement park. It seems it belongs to a boy.'),
(112, 'Dubious Disc', 'General Item', 'A transparent device overflowing with dubious data. Its producer is unknown.'),
(113, 'Durin Berry', 'Berries', 'A Berry which is very rare in the Unova region. A maniac will buy it for a high price.'),
(114, 'Dusk Ball', 'Pokeballs', 'A somewhat different Poké Ball that makes it easier to catch wild Pokémon at night or in dark places like caves.'),
(115, 'Dusk Stone', 'General Item', 'A peculiar stone that makes certain species of Pokémon evolve. It is as dark as dark can be.'),
(116, 'Earth Plate', 'Held Item', 'Increases power of Ground-type moves. Changes Arceus\' type to Ground.'),
(117, 'Eevium Z', 'Held Item', 'Allows Eevee to upgrade Last Resort to a Z-Move, Extreme Evoboost.'),
(118, 'Eject Button', 'Held Item', 'If the holder is hit by an attack, it will switch with another Pokémon in your party.'),
(119, 'Electirizer', 'General Item', 'A box packed with a tremendous amount of electric energy. It is loved by a certain Pokémon.'),
(120, 'Electric Gem', 'Held Item', 'Increases the power of an Electric-type move only once.'),
(121, 'Electric Memory', 'Held Item', 'A memory disc that contains Electric-type data. It changes the type of the holder if held by a certain species of Pokémon.'),
(122, 'Electric Seed', 'Held Item', 'An item to be held by a Pokémon. It boosts Defense on Electric Terrain. It can only be used once.'),
(123, 'Electrium Z', 'Held Item', 'Allows the use of Gigavolt Havoc, the Electric type Z-Move.'),
(124, 'Elevator Key', 'Held Item', 'A card key that activates the elevator in Lysandre Labs. It is emblazoned with Team Flare’s logo.'),
(125, 'Elixir', 'Medicine', 'It restores the PP of all the moves learned by the targeted Pokémon by 10 points each.'),
(126, 'Energy Powder', 'Medicine', 'Restores 60 HP but lowers happiness.'),
(127, 'Energy Root', 'Medicine', 'Restores 120 HP but lowers happiness.'),
(128, 'Enigma Berry', 'Berries', 'If held by a Pokémon, it restores its HP if it is hit by any supereffective attack.'),
